import './App.css';
import { Button, Dropdown } from 'react-bootstrap';

function App() {
  return (
    <div className="App">
      <div id='wrapper'>
        <h1>Statify</h1>
        <h4>Welcome to Statify! Here you can view your top most played songs, artists, and genres from various periods of time. Think of it as a Spotify Wrapped that you can access at any time during the year. Just log in and you're all set!</h4>
        <Button variant='Primary' className="btn-primary">Login</Button>
      </div>
    </div>
  );
}

export default App;
